import LocalizedStrings from 'react-localization';
import {Cookies} from 'react-cookie';
import {biases_eng} from "./eng_biases";
import {biases_ru} from "./ru_biases";

export const languages = [{
    name: "En",
    locale: "en",
    icon: "data:image/png;base64,"
},
    {
        name: "Ru",
        locale: "ru",
        icon: "data:image/png;base64,"
    }];

export const biasCategoriesColor = {
    politics: "#f9b628",
    money: "#27ae8d",
    belief: "#1d8b95",
    learning: "#a7b849",
    social: "#135771",
    memory: "#e95a53"
};

const translations = new LocalizedStrings({
    en: biases_eng,
    ru: biases_ru
});


let lang = new Cookies().get("lang");
if (lang !== undefined) {
    for (let ll of languages) {
        if (ll.locale === lang) {
            console.log("set lang: ", lang);
            translations.setLanguage(lang);
        }
    }
}

export const strings = translations;
